import s from './Nav.module.css'
import {NavLink} from "react-router-dom";
import Dialog from "../Dialogs/Dialog/Dialog";



const Nav = (props) => {
    let NavDataMap = props.store.dispatch({type: 'GET-STATE'}).dialogsData.map( (el)=> {
            return (
                <Dialog name={el.name}/>
            )
        }
    )
    return (
        <nav className={s.nav}>
            <div>
                <NavLink to="/profile">Profile</NavLink>
            </div>
            <div>
                <NavLink to="/dialogs">Dialogs</NavLink>
            </div>
            <div>
                <a>Profile</a>
            </div>
            <div>
                <a>About</a>
            </div>
        </nav>
    )
}

export default Nav;
